import { createRouter, createWebHistory } from "vue-loader"

const Home = () => import("../views/Home")
const About = () => import("../views/About")

export default createRouter({
    history: createWebHistory(),
    routes: [
        {
            path: "/home",
            component: Home
        },
        {
            path: "/about",
            component: About
        }
    ]
})
